import React from 'react';
import {Route, Redirect} from 'react-router-dom';


const PrivateRouter = ({component: Component, isSignedIn, ...rest}) => {

    return (
        <Route {...rest} render={props => (
            isSignedIn ?
                <Component {...props} />
            : <Redirect to="/Signin" />
        )} />
    );
};

export default PrivateRouter;
